DROP TABLE IF EXISTS `api_users`;
CREATE TABLE `api_users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `password` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_lang` char(10) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'en-US',
  `last_login` timestamp NULL DEFAULT NULL,
  `device_id` text COLLATE utf8mb4_unicode_ci,
  `is_allow_biometric` tinyint(1) NOT NULL DEFAULT '0',
  `status` smallint(6) NOT NULL DEFAULT '1',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0',
  `created_by` int(10) unsigned NOT NULL DEFAULT '1',
  `updated_by` int(10) unsigned NOT NULL DEFAULT '1',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `api_users_username_unique` (`username`),
  KEY `api_users_created_by_foreign` (`created_by`),
  KEY `api_users_updated_by_foreign` (`updated_by`),
  KEY `api_users_status_is_deleted_index` (`status`,`is_deleted`),
  KEY `api_users_is_deleted_index` (`is_deleted`),
  CONSTRAINT `api_users_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `api_users_updated_by_foreign` FOREIGN KEY (`updated_by`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

