DROP TABLE IF EXISTS `frequently_asked_question_details`;
CREATE TABLE `frequently_asked_question_details` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `question` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `answer` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `lang` char(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  `frequently_asked_question_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fAQ_details_fAQ_id_foreign` (`frequently_asked_question_id`),
  CONSTRAINT `fAQ_details_fAQ_id_foreign` FOREIGN KEY (`frequently_asked_question_id`) REFERENCES `frequently_asked_questions` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

INSERT INTO `frequently_asked_question_details` (`id`, `question`, `answer`, `lang`, `frequently_asked_question_id`) VALUES
(1,	'How to access door?',	'1. Open the app, your staff QR code is displayed on the homepage\r\n\r\n2. Scan your staff QR code at the door lock scanner\r\n\r\n3. Upon success, the door will open and you will receive a \'Welcome back\' message in the app',	'en-US',	1),
(2,	'What to do if it does not work?',	'1. Try scanning your staff QR code again:\r\na. Ensuring that your WiFi is on and that you are connected to the office\'s WiFi network\r\nb. Ensuring phone is approximately 1ft from the scanner, in the upright position\r\nc. Increasing the brightness of the iPhone screen\r\n\r\n2. Please contact admin for help in the event of multiple unsuccessful attempts',	'en-US',	2),
(3,	'How to view desk availability?',	'1. Open the app to homepage\r\n\r\n2. Click \'View available desks\'\r\n\r\n3. A zone map will be displayed, where:\r\n- Zone(s) highlighted in blue means desks within zone still available\r\n- Zone(s) highlighted in red means desks within zone are almost fully occupied\r\n\r\n4. For a detailed plan of the zone, select your choice of zone by clicking on the zone, where:\r\n- Grey indicates desk is occupied\r\n- White indicates desk is available\r\n- Blue indicates currently selected desk\r\n\r\n5. Zoom in or apply filter(s) to find your choice of desk.\r\n\r\n6. Click on your choice of desk to view its information',	'en-US',	3),
(4,	'How do I check-in to a desk?',	'1. All Flexi-desks have QR codes attached to them\r\n \r\n2. At the desk of your choice, simply open the app to homepage\r\n        \r\n3. Press the \"Scan\" icon at the bottom menu of the screen\r\n        \r\n3. Place the iPhone on top of the QR code to scan\r\n        \r\n4. Press \"Confirm\" to check-in to the desk and you will be redirected back to homepage with a success message.  The desk will be reserved for the day',	'en-US',	4),
(5,	'Can I check-in to a desk if I am outside of the office?',	'No. You will be able to view available desks outside the office; however, you will not be able to book desk outside of office',	'en-US',	5),
(6,	'What to do if it does not work?',	'There are several possible reasons you are not able to check-in to a desk:\r\n- You may be out of office.  Desk check-in is only available when you are in the office and are connected to the office\'s WiFi network\r\n\r\n- Scanning a QR code not made for a Flexi-desk. Please scan a Roche Flexi-desk QR Code\r\n\r\n- The QR code could not be read. Please try again, or if the sticker is damaged, please contact admin for help\r\n\r\n- The desk may have already been reserved. Please find another desk to check-in\r\n\r\n- You may have already checked-in to a desk. To book another desk, please release your current desk.',	'en-US',	6),
(7,	'How can I release my desk?',	'1. Open the app to homepage. If you have checked-in to a desk, you will see your desk information under \"My desk\"\r\n        \r\n2. Click on the \'Release\' button to release your desk\r\n        \r\n3. Click \"Yes\" on the pop up message to release desk and you will receive a \'confirmation message.  Click \"Cancel\" if you do not wish to release your desk',	'en-US',	7),
(8,	'How do I find desks with adjustable desk and/or monitor?',	'1. Click \'View available desks\' in the homepage\r\n\r\n2. Select your choice of zone by clicking on the zone map \r\n\r\n3. On the detailed plan of the zone, click on the filter icon on the top left hand corner\r\n\r\n4. Select your filter(s) choice e.g. Adjustable desk\r\n\r\n5. Click \'Apply\' and the zone plan will be updated to show desk that are adjustable with stars',	'en-US',	8),
(9,	'How to access my locker?',	'1. Open the app, your staff QR code is displayed on the homepage\r\n\r\n2. Scan your staff QR code at the locker\'s scanner\r\n\r\n3. Upon success, the locker will open and you will receive a \'Success\' message in the app',	'en-US',	9),
(10,	'Where do I find my locker number?',	'1. Open the app to homepage\r\n\r\n2. You will find your locker number shown, below \"View available desks\"',	'en-US',	10),
(11,	'What to do if it does not work?',	'1. Try scanning your staff QR code again:\r\na. Ensuring that your WiFi is on and that you are connected to the office\'s WiFi network\r\nb. Ensuring phone is approximately 1ft from the scanner, in the upright position\r\nc. Increasing the brightness of the iPhone screen\r\n\r\n2. Please contact admin for help in the event of multiple unsuccessful attempts',	'en-US',	11),
(12,	'How do I make a purchase at the vending machine?',	'1. Select your item of choice from the vending machine and click purchase for a purchase QR code to appear\r\n\r\n2. Open the app to homepage \r\n\r\n3. Press the \"Scan\" icon, at the bottom menu\r\n\r\n4. Scan the purchase QR code on the vending machine\r\n\r\n5. Review items that you wish to purchase and press \"Next\"\r\n\r\n6. (For item value below $100) Thank you message will be displayed, press \"OK\" to go back to the homepage or \"View purchase history\"\r\n\r\n7. (For item value equal/above $100) Press \"Confirm\" to purchase item or \"Cancel\" to abort purchase.  Upon confirmation, a thank you message will be displayed, press \"OK\" to go back to the homepage or \"View purchase history\"\r\nhe item will come down the vending machine \r\n\r\n8. Your item will be dispensed from the vending machine',	'en-US',	12),
(13,	'What to do if it does not work?',	'1. Try again with a better camera position\r\n \r\n2. Please contact admin for help in the event of multiple unsuccessful attempts',	'en-US',	13),
(14,	'I have a visitor but did not send a meeting invite, how do I help the visitor check-in?',	'1. When your visitor arrives, he/she will need to select the \'Walk-In\' option and the kiosk\r\n\r\n2. Your visitor will fill in all necessary information, take a photo and enter your email\r\n\r\n3. Upon confirmation, you will receive a notification that your guest has arrived\r\n\r\n4. Go to the kiosk to confirm the visitor is who you are expecting\r\n\r\n5. Scan your staff QR code at the kiosk\'s scanner and complete your visitor\'s check-in\r\n\r\n6. Upon completion, your visitor will receive a guest sticker and link for door access QR code',	'en-US',	14),
(15,	'How long is the visitor\'s QR code valid for?',	'The link containing the door access QR code will expire 4 hours after the end of the meeting',	'en-US',	15),
(16,	'Test',	'Test',	'en-US',	16),
(17,	'Accessing the Experience app with Face ID/Passcode',	'When you access the Experience app for the first time, you will be asked to login with your Roche email and password.  \r\n\r\nSubsequently, you will be able to access the app with FACE ID or your iPhone passcode.\r\n\r\nTo Enable the Face ID for this app:\r\na. Go to iPhone \"Settings\" > \"Face ID & Passcode\"\r\nb. Enter your passcode\r\nc. Under \"USE FACE ID FOR\", select \"Other Apps\"\r\nd. Look for \"Experience\" from the list and adjust the toggle to on (green)',	'en-US',	17),
(19,	'Plain text',	'gergheqr',	'en-US',	19),
(20,	'Plain Text?',	'jkhejqbvheklrqbnlwlw grnwbkltyemtukmu6metdghmn ghd\r\nntsmtdmthmtem\r\nmrstmstymetumet',	'en-US',	20),
(21,	'FAQ Detail - Plain Text',	'FAQ Detail - Plain Text',	'en-US',	21),
(22,	'Plain Text',	'hejgvherkbnvjkbefourehbionfjbnjfenqgiobnerj',	'en-US',	22),
(23,	'Cat',	'TESTSTESTSETSETSTSET',	'en-US',	23);

