DROP TABLE IF EXISTS `notification_details`;
CREATE TABLE `notification_details` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `content` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `push_title` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `push_message` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `lang` char(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  `notification_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `notification_details_notification_id_foreign` (`notification_id`),
  CONSTRAINT `notification_details_notification_id_foreign` FOREIGN KEY (`notification_id`) REFERENCES `notifications` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

