(101,	'Working Arrangement in Time of Typhoon & Rainstorm',	'<p>Dear all,</p>\r\n<p>As you are aware, Wipha will move towards the vicinity of western Guangdong today and tomorrow&nbsp;according to the observatory.</p>\r\n<p>In regards of&nbsp;Typhoon&nbsp;Signal No. 8 and Black Rainstorm arrangements,&nbsp;please kindly find the following guideline:</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Warning Raised</u></strong></p>\r\n<p>The office will be closed if&nbsp;typhoons&nbsp;signal no. 8 or above is hoisted, or when the Black Rainstorm warning signal is in force before office hours.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Typhoon</u></strong></p>\r\n<p>When&nbsp;typhoon&nbsp;signal no. 8 is hoisted during office hours, employees may leave immediately unless they are required to stay to carry out urgent duties as advised by their direct supervisor.</p>\r\n<p>In consideration of possible adverse traffic conditions during&nbsp;typhoons,&nbsp;employees who live on outlying islands or in other remote areas may be permitted to leave before the signal no.8 is hoisted.&nbsp;&nbsp;Employees should consult their direct supervisor and get his or her approval for early departure.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Black Rainstorm Warning</u></strong></p>\r\n<p>When the Black rainstorm warning signal is in force during office hours, employee members should normally remain in the office for safety reasons until the signal has been lowered.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Signal No. 8 or Black Rainstorm Warning Lowered</u></strong></p>\r\n<p><strong>If signal No.8 is lowered before working hours, all employee has to report to duty at normal office hour.&nbsp;If it is lowered between on or before 11:00, all employees have to return to work&nbsp;within 2 hours.&nbsp;</strong></p>\r\n<p><strong>All employees will not report to work if No.8 Signal is lowered after 11:00.</strong></p>\r\n<p>Employees who are uncertain whether to report for work or have difficulty in getting to work should contact their supervisors as soon as possible.</p>\r\n<p>With our flexible working hour and arrangement in Roche Hong Kong,&nbsp;please monitor the local news regularly to understand any updates and make the most appropriate and&nbsp;safe&nbsp;working arrangement for yourself.&nbsp;&nbsp;The company will continue to monitor the situation and advise as necessary, please check your email or experience app or what\'s app before work.&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Best Regards,&nbsp;</p>\r\n<p>People Partner Department</p>\r\n<p>Roche Pharma Hong Kong &amp; Macau</p>',	'Working Arrangement in Time of Typhoon & Rainstorm',	'Dear all,\r\n\r\nAs you are aware, Wipha will move towards the vicinity of western Guangdong today and tomorrowaccording to the observatory.\r\n\r\nIn regards ofTyphoonSignal No. 8 and Black Rainstorm arrangements,please kindly find the following guideline:\r\n\r\nWarning Raised\r\n\r\nThe office will be closed iftyphoonssignal no. 8 or above is hoisted, or when the Black Rainstorm warning signal is in force before office hours.\r\n\r\n\r\nTyphoon\r\n\r\nWhentyphoonsignal no. 8 is hoisted during office hours, employees may leave immediately unless they are required to stay to carry out urgent duties as advised by their direct supervisor.\r\n\r\nIn consideration of possible adverse traffic conditions duringtyphoons,employees who live on outlying islands or in other remote areas may be permitted to leave before the signal no.8 is hoisted.Employees should consult their direct supervisor and get his or her approval for early departure.\r\n\r\n\r\nBlack Rainstorm Warning\r\n\r\nWhen the Black rainstorm warning signal is in force during office hours, employee members should normally remain in the office for safety reasons until the signal has been lowered.\r\n\r\n\r\nSignal No. 8 or Black Rainstorm Warning Lowered\r\n\r\nIf signal No.8 is lowered before working hours, all employee has to report to duty at normal office hour.If it is lowered between on or before 11:00, all employees have to return to workwithin 2 hours.\r\n\r\nAll employees will not report to work if No.8 Signal is lowered after 11:00.\r\n\r\nEmployees who are uncertain whether to report for work or have difficulty in getting to work should contact their supervisors as soon as possible.\r\n\r\nWith our flexible working hour and arrangement in Roche Hong Kong,please monitor the local news regularly to understand any updates and make the most appropriate andsafeworking arrangement for yourself.The company will continue to monitor the situation and advise as necessary, please check your email or experience app or what\'s app before work.\r\n\r\n--\r\n\r\nBest Regards,\r\nPeople Partner Department\r\nRoche Pharma Hong Kong & Macau',	'en-US',	101),
