CREATE TABLE `staff_calendar_channels` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `staff_id` bigint(20) unsigned NOT NULL,
  `channel_id` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `calendar_id` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `resource_id` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `expiration` datetime NOT NULL,
  `status` smallint(6) NOT NULL DEFAULT '1',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0',
  `created_by` int(10) unsigned NOT NULL DEFAULT '1',
  `updated_by` int(10) unsigned NOT NULL DEFAULT '1',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `staff_calendar_channels_created_by_foreign` (`created_by`),
  KEY `staff_calendar_channels_updated_by_foreign` (`updated_by`),
  KEY `staff_calendar_channels_status_is_deleted_index` (`status`,`is_deleted`),
  KEY `staff_calendar_channels_is_deleted_index` (`is_deleted`),
  KEY `staff_calendar_channels_staff_id_foreign` (`staff_id`),
  CONSTRAINT `staff_calendar_channels_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `staff_calendar_channels_staff_id_foreign` FOREIGN KEY (`staff_id`) REFERENCES `staff` (`id`) ON DELETE CASCADE,
  CONSTRAINT `staff_calendar_channels_updated_by_foreign` FOREIGN KEY (`updated_by`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

