nd any other terms, conditions, warranties or representations associated with such dealings, are solely between you and such third party. You agree that we shall not be responsible or liable for any loss or damage of any sort incurred as the result of any such dealings or as the result of the introduction of such third parties through the App or the Services.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Confidentiality</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">You shall only make use of any and all information disclosed by Roche to you concerning the business, technology or other affairs of Roche, which is designated or indicated as being the confidential or proprietary information of Roche, or information which you ought from the circumstances reasonably know is confidential or proprietary information of Roche (&ldquo;Confidential Information&rdquo;) for the purpose of the visit.</span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">You undertake that you will keep confidential and not disclose any of Roche\'s Confidential Information other than as may be required by law, a court of competent jurisdiction or any governmental authority, or to your employees, officers, representatives, agents, or affiliates who have a need to know the Confidential Information for the purpose of the visit. You shall ensure that your employees, officers, representatives, agents or affiliates to whom you disclose Roche\'s Confidential Information will comply with this confidentiality provision.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Laws that Govern these Terms</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">These Terms are governed by, and construed in accordance with, t