s) of others or otherwise is not contrary to any applicable laws and regulations.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Indemnity</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">To the fullest extent permitted by law, you agree to defend, indemnify, and hold each of us and our respective officers, directors, employees, agents, licensors and suppliers, harmless from and against any claims, actions or demands, liabilities and settlements including without limitation, reasonable legal and accounting fees, resulting from, or alleged to result from, any User Content that you submit via the App, your access to or use of the App or the Services or your violation of these Terms. However, nothing in these Terms shall exclude or restrict our liability for fraud or fraudulent misrepresentation, or for death or personal injury resulting from negligence, or for any other liability that cannot be excluded or restricted by law.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Disclaimer</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Except as expressly set forth in these Terms and without excluding or limiting any mandatory statutory warranties, to the fullest extent permitted by law, Roche makes no other warranties to you or any third party, whether express or implied, regarding or relating to the App or the Services. In particular, although we make reasonable efforts to update the information provided through the App or the Services, Roche does not warrant that any information provided through the App or the Services is complete, current, correct or accurate. For the avoidance of doubt, we operate the App and provide the Services from our offices in Hong Kong, and we do not warrant that the App or the Services are appropriate or available for use outside of Hong Kong.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Modifications</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">If we modify these Terms in a material way, we will provide notice of such modification within the App. By continuing to access or use the App or the Services after we have modified these Terms, you agree to be bound by the modified Terms. If the modified Terms are not acceptable to you, you agree to immediately stop using the App and the Services.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Assignment</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">You may not assign or transfer these Terms, by operation of law or otherwise, without Roche&rsquo;s prior written consent. Any attempt by you to assign or transfer these Terms, without such consent, will be null and of no effect. Roche may assign or transfer these Terms, at its sole discretion, without restriction. Subject to the foregoing, these Terms will bind and inure to the benefit of the parties, their successors and permitted assigns.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Miscellaneous</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">If any provision of these Terms shall be unlawful, void or for any reason unenforceable, then that provision shall be deemed severed from these Terms and shall not affect the validity and enforceability of any remaining provisions. No waiver of any provision of these Terms by us shall be deemed a further or continuing waiver of such provision or any other provision, and our failure to assert any right or provision under these Terms shall not constitute a waiver of such right or provision.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Notices</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Any notices or other communications permitted or required hereunder, including those regarding material modifications to these Terms, will be in a written form and given: (i) by us via email (in each case to the email address included in your registration information); or (ii) by posting within the App. For notices made by e-mail, the date of transmission will be deemed the date on which such notice is given.</span></p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Contact Us</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">If you have questions about the App, the Services or these Terms, or if you wish to provide feedback, please contact us via the contact details provided on our website at:&nbsp;<a href=\"http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html\">http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html</a>. By submitting feedback, you agree to grant to us a non-exclusive, perpetual, worldwide, irrevocable, transferable and royalty-free license to use, edit, reproduce, distribute, prepare derivative works of and display your feedback for the purpose of providing and improving the App or the Services.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h1><span style=\"font-family: arial, helvetica, sans-serif;\"><strong><span style=\"font-size: 12pt;\">Roche App Privacy Policy</span></strong></span></h1>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">This Privacy Policy applies to the App and the Services. Roche Hong Kong Limited (\"<strong>Roche</strong>\", \"<strong>we</strong>\", \"<strong>our</strong>\") is the data user responsible for the processing of your personal data as described in this Privacy Policy.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Information collected and how information may be used</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">We collect the following information about you:</span></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>The App stores visitors&rsquo; personal data</strong>. When you register as a visitor, you must provide certain personal data such as your email address, name and photograph.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>When you use the App and the Services</strong>. When you use our App or the Services, sign up for updates, or communicate with us, we collect your email, photo, names, company name</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Cookies and similar information.</strong> When you use our App or the Services, we and our third-party partners, such as analytics providers and ad networks, may collect certain information by automated means, such as cookies, web beacons, web server logs and other similar technology.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Information from third party sources</strong>. We may receive additional information about you from third party sources to assist us in providing the App and the Services. Our partners also may collect information about your online activities over time, on other devices, and on other websites or apps.&nbsp; When they provide such services, they are governed by their own privacy policies.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Information from you may be used for the following purposes:</span></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Provision of the App and the Services</strong>. We may use the information collected about you to provide and improve the App and the Services, to conduct research for the development of new Services and further versions of the App and to personalize the App or the Services.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Managing security and your next visits.</strong> We collect, store and analyze information you provide to verify and update your registration information and for the purpose of office security and your next visits.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Communications and account management</strong>. We may use your information to administer your account, respond to your inquiries, fulfill your requests and send you administrative communications about the App or the Services. We use your registration information and other information that we collect about you to send emails, push notifications or other forms of electronic communications for informational and operational purposes, such as account management, customer service, system maintenance, and other service-related purposes. We also use your information to determine how many users have visited certain content or used our App&rsquo;s features, or to prevent fraud.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Marketing</strong>. We may use information, including personal data, to show or send you information including Company events and activities update we think may be useful or relevant to you. When we collect your personal data, you will be allowed to indicate your consent or provide indication of no objection. Once you have provided us your consent or indication of no objection, we will send you direct marketing and other promotional materials from third party sponsors, including pharmaceutical companies.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Investigations and compliance with laws</strong>. We may use your information to detect, investigate and defend against fraudulent or unlawful activity and violations of the <strong><u>Terms</u></strong>. We may access, preserve, and disclose collected information, if we believe doing so is required or appropriate to: comply with law enforcement requests and legal process, such as a police warrant, court order or subpoena; respond to your requests; comply with the law; or protect your, our, or others&rsquo; rights, property, or safety, or if we believe not doing so is likely to prejudice the prevention or detection of crime or the apprehension, prosecution or detention of offenders, or any other situations as provided by local laws and regulations.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Sharing your information with third parties</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">We may share information we collect about you in the following circumstances:</span></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Contractors who work for us</strong>: We work with third party contractors to help us provide the Services and to otherwise assist us in the operation of the App. We may provide these contractors with personal data about users of the App or our Services so that they can fulfill their responsibilities to us. However, we do require that they agree to limit their use of this personal data to the fulfillment of these responsibilities. We will ensure that third-party vendors and service providers adopt privacy policies that are no less restrictive, if not the same, than this Privacy Policy and comply with local laws and regulations. We cannot control how third-party vendors and service providers may disclose your personal data if they reasonably believe that disclosure is necessary for the purpose of preventing or detecting crime or is in the public interest.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Consent</strong>: We may disclose your personal data to a third party in a manner not addressed by this Privacy Policy subject to your consent at such time. In particular, we do not rent, sell, or share personal data about you with other people or nonaffiliated companies for their direct marketing purposes, unless we have your consent.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Aggregated information</strong>. We may provide aggregated and non-identifiable information about users of our App or the Services to third parties as we deem appropriate in our sole discretion.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Social widgets</strong>: We may include social widgets within the App which will enable you to interact with the associated social media services, e.g., to share information. These widgets may collect browsing data which may be received by the third party that provided the widget, and are controlled by these third parties. You may be able to manage your privacy preferences directly with the applicable social network platform.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Business transfers</strong>: We may share your information among the respective websites that we own and with our subsidiaries, affiliates and companies acquired by or merged with us and our affiliates. In the event of a corporate change in control resulting from, for example, a sale to, or merger with, another entity, or in the event of a sale of assets or a bankruptcy, we reserve the right to transfer your personal data to the new party in control or the party acquiring assets. In the event of such a change, your personal data will continue to be treated in accordance with this Privacy Policy, as may be modified as described below.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Legal requirements</strong>: We may release personal data when we believe release (i) is required to comply with valid legal requirements such as a law, regulation, search warrant, subpoena or court order and to meet national security or law enforcement requirements; or (ii) is reasonable in response to a physical threat to you or others, to protect property or defend or assert legal rights of us or others.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>How we store your information</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Your information will be stored safely and securely by Roche or any third-party vendors or service providers engaged by Roche.&nbsp; Your information may be transferred to other parts of the world for storage but we will ensure that adequate levels of protection and other requirements as may be required by applicable law are met prior to transfer of your information outside Hong Kong.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">We also maintain a retention policy that complies with local laws.&nbsp; We will take all practicable steps to ensure that your information is not kept longer than is necessary for the fulfillment of the purposes.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Security of information</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">We have implemented appropriate technical and organizational security measures to protect the personal data that we have under our control from unauthorized access, use and disclosure and accidental loss. When you enter or otherwise provide personal data to us via the App and the Services, we encrypt the transmission of that information. If we learn of a security system&rsquo;s breach, we may attempt to notify you electronically by posting a notice on the App or sending an email to you.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">You are solely responsible for maintaining the security and confidentiality of your account username and password. Unfortunately, no method of transmission over the internet or method of electronic storage is completely secure. Therefore, while we strive to protect your personal data, we cannot guarantee its absolute security.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Choice and control</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Account information</strong>. You may access, update or change your information at any time through the account management feature available on the App, or you may contact us using the information in the \"Contacting Us\" section. Please note that even if we have deleted your account, we may still maintain certain de-identified information about you for internal business purposes including research, analytics and reporting.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Direct marketing</strong>. We will only send you direct marketing after you have provided us with consent to do so in accordance with paragraph \"Marketing\" above. You may opt out of direct marketing by send us an email under contract us.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Push notifications. </strong>We may send you push notifications from time-to-time for the assessment and reminder feature of the App. If you no longer wish to receive these types of notifications, you may turn them off at the device level.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Children\'s privacy</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">We do not knowingly collect, maintain, or use personal data from children under 18 years of age.&nbsp; If you learn that your child has provided us with personal data without your consent, you may alert us via the contact details available on our website at: <a href=\"http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html\">http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html</a>.&nbsp; If we learn that we have collected any personal data from children under 18, we will promptly take steps to delete such data and terminate the child&rsquo;s account.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Privacy Policy changes</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">We reserve the right to modify this Privacy Policy at any time and any changes will be effective upon posting of the modified Privacy Policy unless we advise otherwise. If we make any material changes to this Privacy Policy we will notify you by email (sent to the email address included in your account profile) and/or by means of a notice on the App before the change becoming effective. We encourage you to periodically review this Privacy Policy for the latest information on our privacy practices.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>How we use cookies</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Cookies are small data files of information that a website or mobile application transfers to your hard drive or mobile device to store and sometimes track information about you. Although cookies do identify a user&rsquo;s device, cookies do not personally identify users. Additionally, mobile devices may use other tracking files which are similar to cookies.</span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Why we use cookies</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Our App uses cookies to distinguish you from other users. This helps us to improve our App and to provide you with a good experience when you use our App.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Contacting us</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">If you have general questions about your account, the App or the Services, please contact us via the contact details provided on our website at: <a href=\"http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html\">http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html</a>.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Please note that if you contact us to assist you, we may need to authenticate your identity before fulfilling your request.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong>Effective date</strong>: 20 June 2019</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',	1,	'en-US'),
