DROP TABLE IF EXISTS `terms_and_conditions`;
CREATE TABLE `terms_and_conditions` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `version_number` int(11) NOT NULL,
  `status` smallint(6) NOT NULL DEFAULT '1',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0',
  `created_by` int(10) unsigned NOT NULL DEFAULT '1',
  `updated_by` int(10) unsigned NOT NULL DEFAULT '1',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `terms_and_conditions_created_by_foreign` (`created_by`),
  KEY `terms_and_conditions_updated_by_foreign` (`updated_by`),
  KEY `terms_and_conditions_status_is_deleted_index` (`status`,`is_deleted`),
