INSERT INTO `terms_and_conditions_details` (`id`, `title`, `content`, `lang`, `terms_and_conditions_id`) VALUES
(1,	'Terms and conditions',	'<p><strong>By accessing the app or using the services</strong>, you agree that you have read and understood, and agree to be bound, by the following terms and conditions, including Roche&rsquo;s legal and privacy policy (together, the &ldquo;<strong>terms</strong>&rdquo;).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>General Information</strong></p>\r\n<p>The Roche Experience App (the &ldquo;App&rdquo;), described below, is an application which collects employees&rsquo; information regarding the data analytics and usage of the App and provides its employees with a wide array of services including, without limitation, seats reservation, door and locker access , employee personal data (please refer to the Roche App Privacy Policy regarding the collection, use and access of employee personal data), consumable experience in the office (collectively, the \"Services\") owned by Roche Hong Kong Limited (\"Roche\"). The Services are provided to users of the App subject to the following Terms of Use (the \"Terms\").</p>\r\n<p>Roche Hong Kong Limited (&ldquo;Roche&rdquo;, \"we\", \"our\") provides the Services to you (&ldquo;you&rdquo;, your&rdquo;) as a user.</p>\r\n<p><strong>Account Registration</strong></p>\r\n<p>Your account has been registered under the Roche App to access certain functions and features of the Services. You are solely responsible for maintaining the confidentiality and security of your Roche App account username and password and you may not permit another person to use your username and password to access the Services. You are responsible for all activity that occurs under your account. If you believe that the security of your account information has been compromised, you should immediately change your username and password through the account settings feature or notify us and we will assist you. We shall have no liability for any unauthorized access to or use of your account information.</p>\r\n<p><strong>Use of the Services</strong></p>\r\n<p>The Services are intended for employees. By using the Services, you represent and warrant that you have the right, authority, and capacity to agree to and abide by these Terms and that you are not prohibited from using the Services or any portion thereof.</p>\r\n<p>The information and tools that we make available through the Services are provided for informational purposes only. We make no guarantees, representations or warranties with respect to any Services, and expressly disclaims all such guarantees, representations and warranties of any nature whatsoever, whether statutory, oral, written, express or implied, including, without limitation, any warranties of merchantability or fitness for a particular purpose and any warranties arising from course of dealing or usage of trade.</p>\r\n<p>Subject to your compliance with these Terms, you are granted a limited, non-exclusive, non-transferable and non-sublicensable license to use the Services and to view the information and materials made available through the Services, including User Content, as defined below, (\"Roche App Content\") solely for your use related to work. You shall not use, copy, adapt, modify, prepare derivative works based upon, distribute, license, sell, transfer, publicly display, publicly perform, transmit, stream, broadcast or otherwise exploit the Services, Roche App Content, except as expressly permitted in these Terms. All rights not expressly granted herein are reserved to Roche and their respective licensors, as applicable.</p>\r\n<p>You agree that you will not engage in any of the following activities in connection with your use of the Services:</p>\r\n<ol>\r\n<li>Forge headers or otherwise manipulate identifiers in order to disguise the origin of any content transmitted through the Services;</li>\r\n<li>Use the Services for any illegal purpose or in violation of any local, state, national, or international law;</li>\r\n<li>Interfere with security-related features of the Services, including by: (a) disabling or circumventing features that prevent or limit use or copying of any content; or (b) reverse engineering or otherwise attempting to discover the source code of any portion of the Services, except to the extent that such activity is expressly permitted by applicable law notwithstanding this restriction;</li>\r\n<li>Interfere with the operation of the Services or any user&rsquo;s enjoyment of the Services, including by: (a) uploading or otherwise disseminating any virus, adware, spyware, worm, or other malicious code; (b) making any unsolicited offer or advertisement to another user of the Services; (c) collecting personal information about another user or third party without consent; or (d) interfering with or disrupting any network, equipment, or server connected to or used to provide the Services;</li>\r\n<li>Sell or otherwise transfer the access granted under these Terms or any Materials or any right or ability to view, access, or use any Materials;</li>\r\n<li>Use, display, mirror or frame the App, or any component thereof, or Roche\'s trademark, logo or other proprietary information, without the written consent of Roche, as applicable;</li>\r\n<li>Use the App in any manner not permitted by these Terms.</li>\r\n</ol>\r\n<p>We may (but are not obligated to) do any or all of the following without notice:</p>\r\n<ol>\r\n<li>Record or pre-screen User Content submissions to public areas within the Roche App;</li>\r\n<li>Investigate your use of the Services as we deem appropriate to comply with any applicable law, regulation, government request or legal process;</li>\r\n<li>Remove User Content which we believe does not comply with these Terms of Use;</li>\r\n<li>Terminate your access to the App upon unilateral decision or upon our determination that you have violated these Terms of Use; and</li>\r\n<li>Edit Roche App Content.</li>\r\n<li>Discontinue, temporarily or permanently, the Services (or any part thereof) or eliminate your account and remove any User Content that you have made available through the Services, when (a) requested by law enforcement or other government agencies, (b) technical or security issues or problems are encountered, (c) there are extended periods of inactivity, (d) you are found to have engaged in fraudulent or illegal activities and/or (e) there are circumstances which in Roche&rsquo;s opinion warrants the discontinuation of the Services.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Laws that Govern this Agreement</strong></p>\r\n<p>These Terms are governed by the laws of the Special Administrative Region of Hong Kong without regard to conflict of law principles. You and Roche submit to the personal and exclusive jurisdiction of the courts of the Special Administrative Region of Hong Kong for resolution of any lawsuit or court proceeding permitted under these Terms. We operate the Services from our offices in Hong Kong, and we make no representation that Materials included in the Services are appropriate or available for use in other locations.</p>\r\n<p><strong>Consent to Electronic Communications.</strong></p>\r\n<p>By using the Services, you consent to receiving certain electronic communications from us as further described in our Privacy Policy.</p>\r\n<p><strong>Indemnity</strong></p>\r\n<p>You agree to defend, indemnify, and hold each of us and our respective officers, directors, employees, agents, licensors, and suppliers, harmless from and against any claims, actions or demands, liabilities and settlements including without limitation, reasonable legal and accounting fees, resulting from, or alleged to result from, your access to or use of the App, the Services and the Roche App Content or your violation of these Terms.</p>\r\n<p><strong>Modifications</strong></p>\r\n<p>If we modify these Terms in a material way, we will provide notice of such modification within the App. By continuing to access or use the Services after we have modified these Terms, you agree to be bound by the modified Terms. If the modified Terms are not acceptable to you, you agree to immediately stop using the App and the Services.</p>\r\n<p><strong>Assignment</strong></p>\r\n<p>You may not assign or transfer these Terms, by operation of law or otherwise, without Roche&rsquo;s prior written consent. Any attempt by you to assign or transfer these Terms, without such consent, will be null and of no effect. Roche may assign or transfer these Terms, at its sole discretion, without restriction. Subject to the foregoing, these Terms will bind and inure to the benefit of the parties, their successors and permitted assigns</p>\r\n<p><strong>Notices</strong></p>\r\n<p>Any notices or other communications permitted or required hereunder, including those regarding material modifications to these Terms, will be in a written form and given: (i) by us via email (in each case to the email address included in your Registration Information); or (ii) by posting within the App. For notices made by e-mail, the date of receipt will be deemed the date on which such notice is transmitted.</p>\r\n<p><strong>Contact Us</strong></p>\r\n<p>If you have questions about the Services or these Terms, or you wish to provide feedback, please contact us with the information provide at&nbsp;<a href=\"http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html\">http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html</a>. By submitting feedback and suggestions, you grant a non-exclusive, perpetual, irrevocable, and royalty-free license to any intellectual property rights you may have in your feedback and suggestions to us to use to improve the Services.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Roche App Privacy Policy</strong></p>\r\n<p>This Privacy Policy applies to the employee Experience application owned and operated by Roche Hong Kong Limited (\"Roche\") that are intended to provide update information to employee interaction in working environment. We refer to the application (our &ldquo;App&rdquo;) along with the information and services made available to users of the App, including but not limited to for seat reservation, door and locker access and consumable usages (the &ldquo;Service&rdquo;). References to &ldquo;we&rdquo; or &ldquo;us&rdquo; means Roche Hong Kong Limited.</p>\r\n<p>&nbsp;</p>\r\n<p>By using the Service, you acknowledge that we will store, use and otherwise process your information in Hong Kong where we are located. Except as otherwise noted in this Privacy Policy, Roche is the data controller responsible for the processing of your personal information as described in this Privacy Policy.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How we collect your information</strong></p>\r\n<p>We collect information, including Personal Information, door and locker access, consumable experience in office when you use our App.&nbsp; We also collect information, such as usage statistics by using cookies, server logs, and other similar technology as you use the Service.</p>\r\n<p>&nbsp;</p>\r\n<p>When you use our App, we and our third-party partners, such as analytics providers and ad networks, may collect certain information by automated means, such as cookies, web beacons and web server logs. We may use this information, for example, to determine how many users have visited certain content or used our App&rsquo;s features, or to prevent fraud.&nbsp; We may link this data to your profile.&nbsp; Our partners also may collect information about your online activities over time, on other devices, and on other websites or apps.&nbsp; When they provide such services, they are governed by their own privacy policies, but we will ensure that such policies are no less restrictive, if not the same, than this Privacy Policy and comply with local laws and regulations.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How we use your information</strong></p>\r\n<p>We use information, including Personal Information, for internal, service-related purposes, improve the Service and to conduct research for the development of new services.&nbsp; We may access the account for informational and operational purposes, such as account management, customer service, system maintenance, consumables usage, Email Communications, Push Notifications or other forms of Electronic Communications and other Service-related purposes (together, the &ldquo;<strong>Purposes</strong>&rdquo;). We may anonymize or aggregate data collected through the Service and use and disclose it for any purpose.</p>\r\n<p>&nbsp;</p>\r\n<p>We may share information with our third-party vendors and service providers, to comply with legal obligations, to protect and defend our rights and property, and with your permission.&nbsp; We do not rent, sell, or share Personal Information about you with other people or nonaffiliated companies for their direct marketing purposes, unless we have your permission. We may share any information we receive with vendors and service providers we use to help us provide and improve the Service.&nbsp; For example, we may disclose information to the service providers that help host the Service or send our emails or other forms of electronic communications. We will ensure that third-party vendors and service providers adopt privacy policy that is no less restrictive, if not the same, than this policy and comply with local laws and regulations. We may allow access to data collected by the Service</p>\r\n<p>&nbsp;</p>\r\n<p>We may access, preserve, and disclose collected information, if we believe doing so is required or appropriate to: comply with law enforcement requests and legal process, such as a police warrant, court order or subpoena ;respond to your requests; comply with the law; or protect your, our, or others&rsquo; rights, property, or safety, or if we believe not doing so is likely to prejudice the prevention or detection of crime or the apprehension, prosecution or detention of offenders, or any other situations as provided by local laws and regulations.&nbsp; We cannot control how third-party vendors and service providers may disclose your Personal Information if they reasonably believe that disclosure is necessary for the purpose of preventing or detecting crime or is in the public interest.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How we store your information</strong></p>\r\n<p>Your information will be stored safely and securely by Roche or any third-party vendors or service providers engaged by Roche.&nbsp; Your information may be transferred to other parts of the world for storage but we will ensure that the jurisdiction where Personal Information is stored has law which is substantially similar to, or serves the same purposes as the local laws and regulations. We will also ensure that the third-party vendors and service providers concerned adopt privacy policy that is no less restrictive, if not the same, than this policy and comply with local laws and regulations.</p>\r\n<p>&nbsp;</p>\r\n<p>We also maintain retention policy that complies with local laws.&nbsp; We will take all practicable steps to ensure that your information is not ke<u>p</u>t longer than is necessary for the fulfillment of the Purposes However, you will be allowed to erase such information before the termination of the Service by referring the contact information at <a href=\"http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html\">http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html</a>. Attn: Data Privacy Officer to withdraw your consent.&nbsp; Your information will then be erased by all practicable steps, including by contractual or other means, and be erased with appropriate method of erasure.&nbsp; When your information is required to be erased, we will ensure that all copies will be erased, including those that are processed by any third-party vendors or service providers engaged by Roche.</p>\r\n<p>&nbsp;</p>\r\n<p>However, we are not required to comply with your erasure request if the erasure of data is prohibited by law or it is in the public interest for the data not to be erased.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How we protect your information</strong></p>\r\n<p>We take steps in an effort to treat your information securely and in accordance with this Privacy Policy. We do not accept liability for unintentional disclosure.</p>\r\n<p>&nbsp;</p>\r\n<p>By using the Service or providing Personal Information to us, you agree that we may communicate with you electronically regarding security, privacy, and administrative issues relating to your use of the Service.&nbsp; If we learn of a security system&rsquo;s breach, we may attempt to notify you electronically by posting a notice on the Service or sending an email to you or to inform the relevant local authority.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Privacy Policy Changes</strong></p>\r\n<p>We reserve the right to modify this Privacy Policy at any time and any changes will be effective upon posting of the modified Privacy Policy unless we advise otherwise. If we make any material changes to this Privacy Policy we will notify you by email (sent to the email address included in your account profile) and/or by means of a notice on the App before the change becoming effective. We encourage you to periodically review this Privacy Policy for the latest information on our privacy practices. By continuing to use the Service after changes are made to this Privacy Policy, you agree to such changes.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How we use Cookies</strong></p>\r\n<p>Cookies are small data files of information that a website or mobile application transfers to your hard drive or mobile device to store and sometimes track information about you. Although cookies do identify a user&rsquo;s device, cookies do not personally identify users. Additionally, mobile devices may use other tracking files which are similar to cookies.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Why we use cookies</strong></p>\r\n<p>Our App uses cookies to distinguish you from other users. This helps us to improve our App and to provide you with a good experience when you browse use our App.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Types of cookies we use</strong></p>\r\n<p>We may use the following cookies:</p>\r\n<p>&nbsp;</p>\r\n<p>Strictly necessary cookies: these are cookies that are required for the operation of the App, such as to enable you to log into secure areas.</p>\r\n<p>&nbsp;</p>\r\n<p>Performance cookies: these types of cookies recognise and count the number of users of the App and to see how users move around in each. This information is used to improve the way the App work.</p>\r\n<p>&nbsp;</p>\r\n<p>Functionality cookies: these cookies recognise when you return to the App, enable personalised content and recognise and remember your preferences.</p>\r\n<p>&nbsp;</p>\r\n<p>Targeting cookies: these cookies record your visit to the App, including the individual pages visited and the links followed.</p>\r\n<p>&nbsp;</p>\r\n<p>Generally, the strictly necessary cookies and some performance and functionality cookies only last for the duration of your visit to the App or expire when you close the App: these are known as &lsquo;session cookies&rsquo;. The functionality cookies and some targeting and performance cookies will last for a longer period of time: these are known as &lsquo;persistent cookies&rsquo;.</p>\r\n<p>&nbsp;</p>\r\n<p>Third party cookies: some of the persistent and session cookies used by our App may be set by us, and some are set by third parties who are delivering services on our behalf.</p>\r\n<p>&nbsp;</p>\r\n<p>Blocking cookies: Most websites, mobile devices and apps automatically accept cookies but, if you prefer, you can change your device or app settings to prevent that or to notify you each time a cookie is set.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Please note however, that (as with other websites and apps) by blocking or deleting cookies used on our App you may not be able to take full advantage of our App.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Contacting Us</strong></p>\r\n<p>If you have general questions about your account or the Service, please refer to <a href=\"http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html\">http://www.roche.com.hk/en_HK/home/xxxcontactxxx.html</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>Please note that if you contact us to assist you, we may need to authenticate your identity before fulfilling your request.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Effective date</strong>: 27th&nbsp;May 2019</p>',	'en-US',	1);

